Top_Net_New_Product__1.query:
q = load "${App.Datasets.AccountWhitespacePTB_HyNLN.FullyQualifiedName}";
q = filter q by 'Account_Name' == "Ohana, Inc.";
q = group q by 'Product_Name';
q = foreach q generate 'Product_Name' as 'Product_Name', avg('Propensity_to_Buy')-.3 as 'avg_Propensity_to_Buy';
q = order q by 'avg_Propensity_to_Buy' desc;
q = limit q 4;

NPS_2.query:
q = load "${App.Datasets.Activities_Amills_EasyMigrate_HyNLN.FullyQualifiedName}";
q = group q by all;
q = foreach q generate count()-160 as 'Marketing Score';
q = limit q 2000;

NPS_3.query:
q = load "${App.Datasets.Activities_Amills_EasyMigrate_HyNLN.FullyQualifiedName}";
q = group q by all;
q = foreach q generate count()-173 as 'NPS';
q = limit q 2000;

Revenue_Time_Series_1.query:
q = load "${App.Datasets.Account_Revenue_TimeSeries_HyNLN.FullyQualifiedName}";
q = filter q by date('Date_Year', 'Date_Month', 'Date_Day') in [dateRange([2018,1,1], [2022,1,1])];

q = group q by ('Date_Year', 'Date_Month');

q = foreach q generate 'Date_Year', 'Date_Month', sum('Revenue') as 'sum_Revenue';

q = timeseries q generate 'sum_Revenue' as 'fRevenue' with (length=10, predictionInterval=95, dateCols=('Date_Year','Date_Month', "Y-M"));

q = foreach q generate 'Date_Year' + "~~~" + 'Date_Month' as 'Date_Year~~~Date_Month', coalesce(sum_Revenue,fRevenue)/100 as 'sum_Revenue', fRevenue_high_95/100 as fRevenue_high_95 , fRevenue_low_95/100 as fRevenue_low_95;

q = order q by 'Date_Year~~~Date_Month' asc;
q = limit q 2000;
